import AdminNav from '../../../components/navigation/AdminNav';


const SubCreate = () => {
    return <div className="container-fluid">
        <div className="row">
            <div className="col-md-2">
                <AdminNav />
            </div>
            <div className="col-md-10">
                sub create [age
            </div>
        </div>
    </div>
}

export default SubCreate;
